require 'singleton'

class HWAddr

class Database
	def self.method_missing (*args, &block)
		instance.__send__(*args, &block)
	end

	class Company
		class Range < HWAddr
			attr_reader :company, :address

			def initialize (company, range, address = nil)
				super(range)

				@company = company
				@address = address
			end
		end

		include Enumerable

		attr_reader :name

		def initialize (name, entries = nil)
			@name    = name
			@entries = entries || []
		end

		def add (range, address = nil)
			@entries << Range.new(self, range, address)
		end

		def === (other)
			any? { |r| r =~ other }
		end

		alias include? ===
		alias member?  ===
		alias cover?   ===

		def each (&block)
			@entries.each(&block)
		end
	end

	include Singleton
	include Enumerable

	def initialize
		@companies = {}
	end

	def add (name, range, address = nil)
		company = @companies[name] ||= Company.new(name)
		company.add(range, address)

		self
	end

	def [] (name)
		name = name.to_s

		if HWAddr.valid?(name)
			find { |c| c === name }
		else
			find { |c| c.name == name }
		end
	end

	def each (&block)
		return to_enum unless block

		@companies.each_value(&block)
	end

	def entries (&block)
		return enum_for :entries unless block

		@companies.each {|company|
			company.each {|range|
				yield range
			}
		}
	end
end

end

